const url = [];
for (let id = 1; id <= 30; id++) {
  url.push(
    `https://hacker-news.firebaseio.com/v0/item/${id}.json?print=pretty`
  );
}
async function fetchData() {
  const response = await fetch(url[0]);
  const result = await response.json();
  console.log(result);
}
fetchData();
export default url;
